<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login Page</title>
    <!-- Bootstrap CSS -->
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #f8f9fa;
            font-family: Roboto, sans-serif;
            font-weight: 400;
            font-size: 0.9rem;
        }
        .card {
            width: 100%;
            max-width: 600px;
        }
        .logo {
            width: 32px;
            height: 32px;
        }
        .header-content {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 10px;
            margin-top: 20px;
			margin-bottom: 30px;
        }
        .header-content label {
            margin: 0;
            font-size: 1.34rem;
            font-weight: bold;
        }
        .welcome-text {
            color: #0d6efd; 
            margin-bottom: 10px;
        }
        .form-label,
        .form-control {
            line-height: 1.34em;
        }
        .input-group {
            display: flex;
            flex-direction: column;
        }
        .input-group > .btn {
            margin-top: 10px;
        }
    </style>
</head>
